import React from 'react';

function UserStock(props){
    const {name, price_bought_at, price_now} = props.userStock;

    const calculatePercentageGain = () => {
        console.log(price_now.toString().slice());
        let percentage = parseFloat(price_bought_at)/parseFloat(price_now);
        return percentage;

    }
    return(
        

        <div className="card text-white bg-info mb-1" style={{maxWidth: "60rem"}}>
            <div className="card-header">{name}</div>
            <div className="card-body">
            <h5 className="card-title">price bought at: {price_bought_at}, price now: {price_now}</h5>
            <p className="card-text">{calculatePercentageGain()}</p>
            <button className="btn btn-primary">Sell</button>
            </div>
        </div>
    );
}

export default UserStock;
